import React, { Component } from 'react';
import './App.css';
import { Businesses, Groups } from './config.js';

console.log("config.Businesses:\n" + JSON.stringify(Businesses, null, 2));
console.log("config.Groups:\n" + JSON.stringify(Groups, null, 2));

class App extends Component {
  render() {
    return (
      <div className="App">
        <NewUserForm />
      </div>
    );
  }
}

class NewUserForm extends Component {
  constructor(props) {
    super(props);
    this.state.value = '';
    this.handleSubmission = this.handleSubmission.bind(this);
  }

  render() {
    return(
      <div>
        <form onSubmit={this.handleSubmission()}>
          <label>
            Please tell us about yourself:
          </label><br /><br />

          <div className="inputSection">
            <input className="personalData" id="firstName" type="text" placeholder="First name"></input><br />
            <input className="personalData" id="lastName" type="text" placeholder="Last name"></input><br />
            <input className="personalData" id="age" type="number" placeholder="Age"></input><br />
            <input className="personalData" id="occupation" type="text" placeholder="Current occupation"></input><br />
            <input className="personalData" id="zipCode" type="number" placeholder="Zip code"></input><br />
            <input className="personalData" id="email" type="email" placeholder="Email address"></input><br />
          </div>

          <input className="submitPersonal" type="submit" value="Send" onClick={ showInvestmentChoices() }/>
        </form>
      </div>
    )
  }
}

function showInvestmentChoices() {
  console.log("submit clicked");
}

class InvestmentListing extends Component {
  render() {
    return(
      <p></p>
    )
  }
}

export default App;
